    padding: 0 12px;
    color: #f9e2af;
    background: #313244;
    border-radius: 6px;
    transition: all 0.2s ease;
}

#memory:hover {
    background: #45475a;
    color: #fae3b0;
}

/* Network */
#network {
    padding: 0 12px;
    color: #a6e3a1;
    background: #313244;
    border-radius: 6px;
    transition: all 0.2s ease;
}

#network:hover {
    background: #45475a;
    color: #b8e5c7;
}

#network.disconnected {
    color: #f38ba8;
}

/* PulseAudio */
#pulseaudio {
    padding: 0 12px;
    color: #94e2d5;
    background: #313244;
    border-radius: 6px;
    transition: all 0.2s ease;
}

#pulseaudio:hover {
    background: #45475a;
    color: #b5eef5;
}

#pulseaudio.muted {
    color: #f38ba8;
    background: #313244;
}

